void format(std::ostringstream &ss, const char *s);

template<typename t, typename... Args>
static void format(std::ostringstream &ss, const char *s, t &value, Args... args)
{
 while (*s) {
  if (*s == '$' || *s == '#') {
   if (*s == '#') ss << "0x" << std::hex;
   ss << value;
   format(ss, ++s, args...);
   return;
  }

  ss << *s++;
 }

 throw std::runtime_error("too many arguments provided to format");
}

template<typename... Args>
std::string format(const char *s, Args... args)
{
 std::ostringstream ss;
 format(ss, s, args...);
 return ss.str();
}
